import { useEffect, useState } from 'react';
import axios from 'axios';

export default function MyUploads({ userId }) {
  const [uploads, setUploads] = useState([]);

  useEffect(() => {
    if (!userId) return;
    axios.get(`http://localhost:5000/api/artworks/uploaded/${userId}`)
      .then(res => setUploads(res.data));
  }, [userId]);

  return (
    <div>
      <h2>My Uploaded Artworks</h2>
      {uploads.map((art) => (
        <div key={art._id}>
          <h4>{art.title}</h4>
          <img src={art.image} alt={art.title} width="200" />
          <p>Price: â‚¹{art.price}</p>
          <p>Status: {art.sold ? "Sold" : "Available"}</p>
        </div>
      ))}
    </div>
  );
}
